ired by the historical precedent set in his native city of Detroit and his adopted hometown of Berlin. His musical output is shaped by pioneering artists like Richie Hawtin, Kevin Saunderson and Moodymann in the US, in addition to European heavyweights like Pantytec, Ricardo Villalobos, and Thomas Brinkmann. Situated loosely between these two defining poles, alongside his partners in Visionquest: Shaun Reeves, Seth Troxler and Lee Curtiss, Ryan delivers a obsessive attention to the constant progression of his sound and embodies a ceaseless energy that carries itself from the studio directly into his live set and DJ performances. Whether it's solo in the studio or as a guiding hand in the Visionquest label and DJ/production partnership, Ryan consistently chooses to steer away from the predictable circuit of so-called "underground" club hits, instead favouring a process of constant renewal, returning both to early influential material and to emerging sounds that depart from well-trodden trends. As a key member of Visionquest, Ryan is responsible for much of the concepting and day to day running of what has rapidly become one of dance music's most cherished new labels. Between them, Ryan and his partners in Visionquest have honed a whole new landscape of lush, organic techno and more esoteric leftfield electronica, gambling against the predicable to introduce emerging talent like Tale Of Us, Maceo Plex, Footprinz, Laura Jones and Mathew Burton to the record buying public. Their efforts were rewarded when their label was voted number seven in Resident Advisor's 2011 label poll, no mean feat given that it's back catalogue has only recently hit double digits.

